CREATE DEFINER=`root`@`localhost` PROCEDURE `ppPlant`(
in id int
)
BEGIN
select	Categories_Name, 
			Cons_Status_Name, 
			Genus_Name, 
			Plant_Scient_Name, 
			Species_Name,
			Family_Name,
			Order_Name,
			Class_Name from Plants p
				inner join Categories c on p.Categories_Id = c.Categories_Id
				inner join Conservation_Status cs on p.Cons_Status_Id = cs.Cons_Status_Id
				inner join Genera g on p.Genus_Id = g.Genus_Id 
				inner join Families f on g.Family_Id = f.Family_Id
				inner join Orders o on f.Order_Id = o.Order_Id
				inner join Classes cl on o.Class_Id = cl.Class_Id
			where Plant_Id = id;
END ;;
DELIMITER ;
