CREATE DEFINER=`root`@`localhost` PROCEDURE `ppSearch`(
in search_content varchar(50), 
in pag_num int
)
BEGIN

    SET @contador = 0;
    SET @var = pag_num * 10;

    SELECT Plant_Scient_Name, link from (
    select
        (@contador:= @contador + 1) as c,
        Plant_Scient_Name,
        Plant_Id AS link
    FROM Plants
    WHERE Plant_Scient_Name LIKE concat('%', search_content, '%') 
    OR Species_Name LIKE concat('%', search_content, '%') 
    ORDER BY Plant_Id)  as a
     where c > @var and c <= @var + 10 ;

Select COUNT(Plant_Id) as count
		from Plants 
		where Plant_Scient_Name like concat('%',search_content,'%') 
			or Species_Name like concat('%',search_content,'%');
END ;;
DELIMITER ;
